data = data.replace("#", "##").replace("O", "[]").replace(".", "..").replace("@", "@.")

board, moves = data.split("\n\n")
m = dict()
pos = 0+0j
for y, row in enumerate(board.split("\n")):
    for x, letter in enumerate(row):
        if letter == "#":
            continue
        p = x+y*1j
        if letter == "@":
            pos = p
            m[p] = "."
            continue
        m[p] = letter

def draw(m=m, b=board):
    for y in range(b.count("\n")+1):
        row = ""
        for x in range(b.find("\n")):
            p = x+y*1j
            if p not in m:
                row += "#"
            elif p == pos:
                row += "@"
            else:
                row += m[p]
        print(row)

def move(d, pos, m=m):
    newPos = pos
    boxes = set()
    #move = True
    newPos = newPos + d
    if newPos not in m:
        return pos
    elif m[newPos] in {"[","]"}:
        boxes.add(newPos)
        if m[newPos] == "[":
            boxes.add(newPos+1)
        else:
            boxes.add(newPos-1)
        while True:
            newBoxes = set()
            for i in boxes:
                if i+d not in m:
                    return pos
                if m[i+d] in {"[","]"}:
                    newBoxes.add(i+d)
                    if m[i+d] == "[":
                        newBoxes.add(i+d+1)
                    else:
                        newBoxes.add(i+d-1)
                    continue
            if newBoxes.issubset(boxes):
                break
            boxes.update(newBoxes)
        vals = dict()
        for box in boxes:
            vals[box] = m[box]
            m[box] = "."
        for k, v in vals.items():
            m[k+d] = v
        return newPos

    else:
        return pos+d
            
for i in moves:
    if i == "\n":
        continue
    match i:
        case "^":
            pos = move(-1j, pos)
        case "v":
            pos = move(1j, pos)
        case ">":
            pos = move(1, pos)
        case "<":
            pos = move(-1, pos)
draw()

total = 0
for p, l in m.items():
    if l == "[":
        total += 100*p.imag + p.real
print(int(total))